import styles from './TireIthem.module.css';

const TireIthem = (props) => {
  const formattedPrice = `грн${props.price.toFixed(2)}`;

  return (
    <li className={styles.tire}>
      <div>
        <h3>{props.name}</h3>
        <div className={styles.description}>{props.description}</div>
        <div className={styles.price}>{formattedPrice}</div>
      </div>
      <div>

      </div>
    </li>
  );
};

export default TireIthem;
